3.1.1. 3.1.1.关联QuickEvent 引入 QUICK_EVENT 宏让你的自己定义的类具有 发布和订阅 事件的能力； QuickWork、QuickScript 默认已经引入QUICK_EVENT。 // 使用QUICK_EVENT宏
class Dialog : public QDialog { Q_OBJECT QUICK_EVENT(QDialog) public: explicit Dialog(QWidget *parent = nullptr); ...
}; // 继承自QuickWork
class UserWork : public QuickWork { Q_OBJECT public: Q_INVOKABLE explicit UserWork(QObject *parent = nullptr); ...
}; 注: QObject 及其子类才能通过 QUICK_EVENT 宏引入发布订阅； 3.1.2. 3.1.2.订阅消息 QuickApplication 提供了 subscibeEvent 方法用来订阅一个消息。 QUICK_SUBSCIBE 宏可以实现便捷订阅。 // 订阅show_time消息
Dialog::Dialog(QWidget *parent) : QDialog(parent), ui(new Ui::Dialog) { ui->setupUi(this); QuickApplication::subscibeEvent(this, "show_time"); ...
} // QUICK_SUBSCIBE便捷订阅事件
SessionManager::SessionManager(QuickWork *parent) : QuickWork(parent) { QUICK_SUBSCIBE("Manager_LoginType") QUICK_SUBSCIBE("Widget_SessionType") this->Initial();
} QUICK_SUBSCIBE 定义： #define QUICK_SUBSCIBE_OBJ(obj,name)\ QuickApplication::subscibeEvent(obj, name);
#define QUICK_SUBSCIBE(name)\ QuickApplication::subscibeEvent(this, name);
#define QUICK_SUBSCIBE_H(name,lev)\ QuickApplication::subscibeEvent(this, name,lev);
#define QUICK_SUBSCIBE_L(name,lev)\ QuickApplication::subscibeEvent(this, name,100+lev); 3.1.3. 3.1.3.发布消息 QuickApplication 提供了 publishEvent 方法用来发布一个消息。 QUICK_PUBLISH1 宏可以实现便捷发布事件。 // 发布show_time消息
TestWork::TestWork(QObject *parent) : QuickWork(parent) { QTimer::singleShot(2000, this, []() { auto time = QDateTime::currentDateTime(); QuickApplication::publishEvent("show_time", Qt::AutoConnection, time); });
} // QUICK_PUBLISH便捷发布消息
void RightControlManager::Slot_WidgetRightControlType(const qint32 &type) { switch (type) { case RightControlWidget::Remodel: { QUICK_PUBLISH1("Manager_RightControlType", qint32(RightControlWidget::Remodel)) break; } default: break; }
} publishEvent 定义： template<class ...Args>
static void publishEvent(QByteArray eventName, Qt::ConnectionType type, Args &&... args) { ...
} QUICK_PUBLISH 定义： 自动模式发布 QUICK_PUBLISHX ，X表示发布参数数量 同步触发模式发布 QUICK_Direct_PUBLISHX ，X表示发布参数数量 异步触发模式发布 QUICK_Queued_PUBLISHX ，X表示发布参数数量 异步等待模式发布 QUICK_BlockingQueued_PUBLISHX ，X表示发布参数数量 #define QUICK_PUBLISH1(name,arg1)\ QuickApplication::publishEvent(name,Qt::AutoConnection, arg1);
