} bool QuickApplication::UnsubscribeEvent(QObject *listener) { QWriteLocker loker(&s_lock); foreach (auto var, s_quick_event_pool.keys()) { s_quick_event_pool[var].remove(s_quick_event_pool[var].key(listener)); } foreach (auto var, s_quick_event_pool_low.keys()) { s_quick_event_pool[var].remove(s_quick_event_pool[var].key(listener)); } foreach (auto var, s_quick_event_pool_high.keys()) { s_quick_event_pool[var].remove(s_quick_event_pool[var].key(listener)); } return true;
} QUICK_DESTRUCT 定义： #define QUICK_DESTRUCT \ QuickApplication::UnsubscribeEvent(this);\ 3.1.6. 3.1.6.订阅优先级 默认情况下跟Qt的信号槽一样，根据订阅顺序依次接受并处理消息。 QuickEvent 把订阅者分为三类，高级别、默认、低级别。当发布消息后，所有订阅者按照高级订阅、默认订阅、低级订阅的顺序依次执行。其中高级订阅和低级订阅分别有自己的顺序，默认订阅则无序。 static QMap < QByteArray, QMap<qint32, QObject *> > s_quick_event_pool_high; static QMap < QByteArray, QMap<qint32, QObject *> > s_quick_event_pool; static QMap < QByteArray, QMap<qint32, QObject *> > s_quick_event_pool_low; 3.1.7. 3.1.7.发布订阅类型 QuickEvent 发布订阅支持四种模式。 请注意，使用 QuickEvent 时往往不清楚对方详细代码，使用阻塞发布请务必小心，防止死锁！ ConnectionType::AutoConnection, // 自动模式发布, // 订阅者者和发布者在同一个线程使用同步调用。 // 订阅者和发布者不在一个线程采用异步调用。 // 调用时按照顺序执行 QuickApplication::methodIndex调用 ConnectionType::DirectConnection, 同步触发模式发布 // 把本线程所有订阅者打包到一个列队依次顺序执行 ConnectionType::QueuedConnection, 异步触发模式发布 // 把每个线程单独打包成列队，每个线程内依次执行 QApplication::postEvent ConnectionType::BlockingQueuedConnection, 异步等待模式发布 // 把所有线程所有订阅者按照订阅顺序打包，依次调用 // QuickApplication::methodIndex调用

