只使用 QuickEvent 的发布订阅功能无需初始化。 QuickEvent 的控制类反射与生存周期管理 QuickController 需要在main函数中初始化。 QUICK_INSTALL() 宏和 QUICK_INSTALL_DETAILED() 宏均可实现初始化， QUICK_INSTALL_DETAILED() 增加了打印 QuickEvent 更详细的相关信息，比如版本信息、详细发布订阅列队等，方便调试使用。 #include "dialog.h"
#include <QuickEvent>
#include <QFile>
int main(int argc, char **argv) { QApplication a(argc, argv); QUICK_INSTALL()// QUICK_INSTALL QUICK_INSTALL_DETAILED QUICK_SETSTYLE("../../Examples/resource/Style/gray_style.qss") Dialog dialog; dialog.show(); return a.exec();
}
